import {Link} from "react-router-dom";
import Navbar from "./Navbar";
import "./FarmList.css";

function FarmList() {
  const FarmBox = (
    <div className="farmBox">
      <button className="accordion">Accordion #</button>
      <div className="accordionContent">
        <p>
          Lorem ipsum dolor sit amet, consectetur adipisicing elit. Consequuntur
          aliquid, unde illo vero maiores quisquam repudiandae saepe, impedit
          laborum quo provident dicta dolorum iure officia, tempora obcaecati?
          Ad, id fugiat!
        </p>
      </div>
    </div>
  );

  return (
    <div>
      <Navbar />
      <FarmBox />
    </div>
  );
}
